import normie from './normal.png'

const Header = () => {
        const CustomProgressComponent = () => {
                const progress = 70; 
        }
    return (   
        <div>
                <Button id='LoginButt' href="./login">Login</Button>

                <div>
                    <ProgressBar id='total_progress' now={50}/>    
                </div>

                <div className='image'>
                    <image className="image" src="./normal.png" />
                </div>
                


                
        </div>
    )
  };

  
  export default Header;
